cmd-welcome-help:
Habilita un mensaje que será enviado al canal cuando alguien se una al servidor.
Si escribes una url de una imagen en el mensaje, automáticamente esconde el enlace.
En tus mensajes puedes usar las siguientes palabras clave y estas serán reemplazadas:

@name : Nombre de usuario
@mention : Mención de usuario
@serv : Nombre del servidor
@id : ID de usuario
@number : Numero de usuarios en el servidor

